import React from "react";
import './Header.css';
import MenuIcon from "@material-ui/icons/Menu";
import SearchIcon from "@material-ui/icons/Search";
import VideoCallIcon from "@material-ui/icons/VideoCall";
import AppsIcon from "@material-ui/icons/Apps";
import NotificationsIcon from "@material-ui/icons/Notifications";
import Avatar from '@material-ui/core/Avatar';


function Header() {
  return (
    <div className="header">
      <MenuIcon />
      <img
        clasName="header_logo"
        src="https://upload.wikimedia.org/wikipedia/commons/thumb/9/98/YouTube_Logo.svg/512px-YouTube_Logo.svg.png"
        alt=""
      ></img>

      <input type="text"></input>
      <SearchIcon />
      <VideoCallIcon />
      <AppsIcon />
      <NotificationsIcon />
      <Avatar alt="shreyas pic" src="https://avatars3.githubusercontent.com/u/31839853?s=460&u=fe13b7acef9deccb10c2a56bcf792f5ffdc10ce7&v=4" />

    </div>
  );
}

export default Header;
